var EffecktDemos={contribURL:"https://api.github.com/repos/h5bp/Effeckt.css/contributors?callback=?",init:function(){$(window).load(function(){$(".no-transitions").removeClass("no-transitions")}),stroll.bind(".effeckt-demo-list-scroll ul"),this.getContributorsData()},getContributorsData:function(){var t=this;$.ajax({type:"GET",url:this.contribURL,async:!1,contentType:"application/json",dataType:"jsonp",success:function(o){t.listContributors(o.data)},error:function(t){console.log(t.message)}})},listContributors:function(t){var o="";$(t).each(function(t,i){o+='<li><a href="'+i.url.replace("api.","").replace("users/","")+'"><img src="'+i.avatar_url+'" alt="'+i.login+'" class="contributor-avatar"></a></li>'}),$(o).appendTo("#contributors-list")}};EffecktDemos.init();
